import React from "react";
import styled from "styled-components";

const Yus = () => {
  return (
    <Container>
      <h3>Why Us</h3>
      <IconContainer></IconContainer>
    </Container>
  );
};

export default Yus;

const Container = styled.div`
  height: 30vh;
  width: 100%;
  background-color: #151515;
`;
const IconContainer = styled.div`
  width: 80%;
  margin: 0 auto;
  display: grid;
`;
